import React, { Component } from "react";
import Aux from "../hoc/Auxiliary";
import Product from "../../components/product/product";

class Store extends Component {
  render() {
    return (
      <Aux>
        <div>Slider</div>
        <div className="products">
          <Product />
          <Product />
          <Product />
          <Product />
          <Product />
        </div>
      </Aux>
    );
  }
}

export default Store;
